; WITH CTE 
AS 
(
SELECT *, RANK() OVER (PARTITION BY AccountUUID ORDER BY SN) [RANK]
FROM #TempData T
)
SELECT * INTO #TempData1 FROM CTE WHERE [RANK] = 1


DROP TABLE IF EXISTS #TempRecords
SELECT T1.*, BP.acctId, BP.AccountNumber, CBRComplianceCode
INTO #TempRecords
FROM BSegment_Primary BP WITH (NOLOCK)
JOIN BSegment_Secondary BS WITH (NOLOCK) ON (BP.acctId = BS.acctId)
JOIN #TempData1 T1 ON (T1.AccountUUID = BP.UniversalUniqueID)

DROP TABLE IF EXISTS #POD2
SELECT T1.*
INTO #POD2
FROM #TempData T1
LEFT JOIN #TempRecords T2 ON (T1.AccountUUID = T2.AccountUUID)
WHERE T2.AccountUUID IS NULL


SELECT * FROM #POD2


SELECT *,
'UPDATE TOP(1) BSegment_Secondary SET CBRComplianceCode = ''' + CCC + ''' WHERE acctID = ' + TRY_CAST(acctId AS VARCHAR),
'UPDATE TOP(1) BSegment_Primary SET TpyBlob = NULL, TpyNAD = NULL, TpyLAD = NULL WHERE acctID = ' + TRY_CAST(acctId AS VARCHAR)
FROM #TempRecords


SELECT CCC, COUNT(1) FROM #TempRecords GROUP BY CCC


DROP TABLE IF EXISTS #TempData
CREATE TABLE #TempData (SN DECIMAL(19, 0) IDENTITY(1,1), AccountUUID VARCHAR(64), CCC VARCHAR(15))

